import React, { Component } from "react";
import AppNavbar from "./appNavbar";
import AppSidebar from "./appSidebar";
import { Layout } from "antd";
const { Header, Footer, Sider, Content } = Layout;
class App extends Component {
  render() {
    return (
      <Layout>
        <Header>
          <AppNavbar />
        </Header>
      </Layout>
    );
  }
}

export default App;
